import * as Actions from './actions';
import initialState from '../store/initialState';

export const UseReducer = (state = initialState.users, action) => {
  switch(action.type) {
    case Actions.SIGN_IN:
      return {
        ...state,
        ...action.payload
      }
    default:
      return state
  }
};
